import React from "react";
import { Link } from "react-router-dom";

export default function Navbar() {
  return (
    <nav className="navbar navbar-expand-lg navbar-dark bg-primary shadow">
      <div className="container">
        <Link className="navbar-brand fw-bold" to="/">
          <i className="bi bi-speedometer2"></i> Dashboard Admin
        </Link>
        <div>
          <Link className="nav-link d-inline text-light" to="/users">
            <i className="bi bi-people"></i> Utilisateurs
          </Link>
          <Link className="nav-link d-inline text-light" to="/passages">
            <i className="bi bi-clock-history"></i> Passages
          </Link>
        </div>
      </div>
    </nav>
  );
}
